interface ICreateModalProps {
    className?: any;
    modalRef?: any;
}

const CreateModal: React.FunctionComponent<ICreateModalProps> = (props) => {

    const {className, modalRef} = props;

  return <div ref={modalRef} className={`${className} modal`}>
            <p>Meu modal!</p>
         </div>
